      //     </p>
      //     {/* <a
      //       className="App-link"
      //       href="https://reactjs.org"
      //       target="_blank"
      //       rel="noopener noreferrer"
      //     >
      //       APU Support Chat
      //     </a> */}
      //   </header>
      //   <Link to='../pages/APUSupport'>APU Support Chat</Link>
      // </div>
    );
  }
}

export default App;
